        </div>

        <nav className="nav">
          <NavLink to="/" end className="nav-link">
            Home
          </NavLink>
          <NavLink to="/stocks" className="nav-link">
            Stocks
          </NavLink>
          <NavLink to="/contact" className="nav-link">
            Contact
          </NavLink>
          <NavLink to="/admin" className="nav-link admin">
            Admin
          </NavLink>
